        for (var i = 0; i < dictionaryKeys.length; i++) {
            var v = "str";
            if (i > 0) {
                v = v + "O";
            }
            var replacement = dictionary[dictionaryKeys[i]];
            var original = aDictionary[i];
            console.log(v, replacement);
            var OLD = JSON.stringify(original);
            var NEW = JSON.stringify(replacement);
            lines.push("\n\tstrO = strings.Replace(" + v + "," + OLD + "," + NEW + ",-1)");
        }
        var nameSanitized = name.replace(/ /g, "SPACER222").replace(/\W/g, "").replace(/SPACER222/g, "_");
        var prefix = "c_CoolText_";
